import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <div class="container">
        <div class="navbar">
          <div class="habit-rabbit top-right">
            Habbit Rabbit
          </div>
          <div class="home-button right-align p-sm-2">
            Home
          </div>
          <div class="home-button right p-sm-2">
            About
          </div>
          <div class="home-button right p-sm-2">
            Sign In
          </div>
        </div>
      </div>  
    </div>
  );
}

export default App;
